import React from "react";
import AboutSection from "../about/About";
import Copyright from "../copyright/Copyright";
import Footer from "../footer/Footer";
import Navbar from "../navbar/Navbar";

const AboutPAge = () => {
    return (
        <>
            <Navbar/>
            <AboutSection/>
            <Footer/>
            <Copyright/>
        </>
    )
}


export default AboutPge;
